() => {
  const handleButtonClick = async () => {
    const selectRacingPeriodValue = SelectRacingPeriod.selectedOptionValue;
    let result;
    if (selectRacingPeriodValue === 'true') {
      result = await SelectData_MainDraw.run();
    } else {
      result = await SelectData_NoMainDraw.run();
